import React from 'react';
import selfie from '../images/SelfPortrait.png';

export const Header = () => {
  return (
    <div className='flex flex-wrap border justify-center items-baseline h-screen'>
      <div className='text-end pt-72 pb-72'>
        <div className='text-9xl font-oswald border '>Cory Carroll
      <img
          className='selfie border md:w-1/3 max-w-xs mb-4 md:mb-0 ml-80'
          src={selfie}
          alt='Selfie'
        />
        </div>
        <div className='mt-4'>
          <p className='text-2xl font-poppins'>
            I am a Full Stack Web Developer based in Salt Lake City, Utah. I am currently open to work and am actively seeking employment.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Header;
